
public class D05 {

	public static void main(String[] args) {
		System.out.println("A1:" + react(getInput(), ' '));
		System.out.println("A2:" + reactWhenRemoved());
	}

	private static int reactWhenRemoved() {
		// A-Z = 65-90
		// a-z = 97-112
		char startChar = 'A';
		int smallInt = 100000;
		for (int i = 0; i < 26; i++) {
			char c = (char) (startChar + i);
			int length = react(getInput(), c);
			if (length < smallInt) {
				smallInt = length;
			}
		}
		return smallInt;
	}

	private static int react(char[] input, char removeChar) {
		boolean madeReplacement = true;
		String result = "";
		
		String tmp = "";
		for (int i = 0; i < input.length; i++) {
			if (!(input[i] == removeChar || input[i] == removeChar + 32)) {
				tmp = tmp + input[i];
			}
		}
		
		char[] localInput = tmp.toCharArray();
		while (madeReplacement) {
			boolean localMadeReplacement = false;
			for (int j = 0; j < localInput.length; j++) {
				// if there are just one char left,
				// and then nothing to compare with
				if (localInput.length == j+1) {
					result = result + localInput[j];
				} else {
					// pairs should be removed
					if (!((localInput[j] + 32 == localInput[j+1]) || (localInput[j] - 32 == localInput[j+1]))) {
						result = result + localInput[j];
					} else {
						// remove and skip next
						j++;
						localMadeReplacement = true;
					}
				}
			}
			localInput = result.toCharArray();
			result = "";
			madeReplacement = localMadeReplacement;
		}
		return localInput.length;
	}
	
	private static char[] getInput() {
		return "".toCharArray();
	}
}
